import React, {Component} from 'react'

class Bottom extends Component{
    render(){
        return(
            <div className="bottomContainer">
                <h4>Support Policys Cookies <img src="/test-static/stripe.png"/></h4>
            </div>
        )
    }
}

const divStyle = {
    float: "bottom"
}
export default Bottom;
